    </div>
  );
}
export default function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/produtos" element="Produtos"/>
          <Route path="/categorias" element="Categorias"/>
          <Route path="/meus-pedidos" element="Meus pedidos"/>
        </Routes>
      </BrowserRouter>
    </div>
  )
}
